description:
Netter's Anatomy Flash Cards are the most convenient and portable way to review anatomy on the fly. This 3rd Edition contains full-color illustrations from Netter's Atlas of Human Anatomy, 5th Edition paired with concise text identifying those structures and reviewing relevant anatomical information and clinical correlations. Online access at studentconsult.com lets you review anatomy from any computer, plus additional &quot;bonus&quot; cards and over 300 multiple-choice questions. Netter. It's how you know.


